import React, { Component } from 'react';

class Detail extends Component {

    state={
        persons:[]
    }
    async componentDidMount() {
        axios.get('http://127.0.0.1:8000/api')
            .then(res => {
            const p = res.data;
            this.setState({ persons:p });
        });
        
    }
    render() {
        return (
           <h1>Detail</h1>
        );
    }
}

export default Detail;
